import styles from './PartItem.module.css'

const PartItem = ({part}) => {
    return (
        <div className={styles.PartItem__container}>
            <img className={styles.PartItem__item}>
                <div className={styles.PartItem__logo} src></div>
            </img>
        </div>
    );
};

export default PartItem;
